const Footer = () => {
    return (
        <footer className="w-full absolute bottom-0 p-4 bg-gray-200 flex flex-col items-center">
            <p>&copy; 2025 Tanmay Gupta</p>
            <div className="flex gap-1 mt-2">
                {Array.from({ length: 11 }).map((_, index) => {
                    const angle = (index - 5) * 10; // Adjust angle (-50 to +50 degrees)
                    return (
                        <div
                            key={index}
                            className="w-1 h-12 bg-black"
                            style={{
                                transform: `rotate(${angle}deg)`,
                                transformOrigin: "bottom center",
                            }}
                        ></div>
                    );
                })}
            </div>
        </footer>
    );
};

export default Footer;
